import axios from "axios"
import { useEffect, useState } from 'react';

function App() {

  const [listOfPost, setListOfPost] = useState([])

  useEffect (()=>{
    axios.get("http://localhost:3001/posts").then((response)=>{
      setListOfPost(response.data)
    })
  }, [])

  return (
    <div className="App">

    </div>
  );
}

export default App;
